sitenews[0] = 'A place for all Royalists in past and present. Visit http://www.forums.inforoyal.com';sitenews[1] = 'Get new school magazine from the downloads section';messages[0] = "No new items";messages[0] = '<p>The first term will be started on 9 January 2012 for the new year.</p>';messages[1] = '<div>The IT Mastermind Quiz 2011, an all island inter-school IT quiz competition was jointly organized by ESOFT and the Computer Society of Sri Lanka. The top 200 were selected in an online test. There was a written test to select the top 64 from the top 200. The top 64 was divided into 8 groups and each group participated in a preliminary round, where a student from each group was selected for the finals.</div><div><br />Eksith Weerasekera of Royal College, became the 2nd runner up of preliminary round 8. This round is telecast on 27th November from&nbsp;<span>5.30 p.m. to 6.00 p.m. on ITN.</span></div>';messages[2] = '<table border="1" cellspacing="0" cellpadding="0" width="618">    <tbody>        <tr>            <td valign="top" width="126">            <div style="text-align: left"><u><strong>Date</strong></u></div>            </td>            <td valign="top" width="180">            <div style="text-align: left"><u><strong>Time</strong></u></div>            </td>            <td valign="top" width="312">            <div style="text-align: left"><u><strong>Subject</strong></u></div>            </td>        </tr>        <tr>            <td valign="top" width="126">            <div>24.11.2011</div>            <div>(Thursday)</div>            </td>            <td valign="top" width="180">            <div>8.00 a.m.-10.00 a.m.</div>            <div>10.30a.m.-12.30 p.m.</div>            </td>            <td valign="top" width="312">            <div>Sinhala Language/Tamil Language</div>            <div>History</div>            </td>        </tr>        <tr>            <td valign="top" width="126">            <div>25.11.2011</div>            <div>(Friday)</div>            </t