bject</strong></u></td>            <td><u><strong>Time</strong></u></td>        </tr>        <tr>            <td>05.12.2011</td>            <td>Chemistry I / ICT&nbsp; I</td>            <td>7.30 a.m. -&nbsp;9.30 a.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>Chemistry II / ICT&nbsp; II</td>            <td>10.00 a.m. - 1.00 p.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>&nbsp;</td>            <td>&nbsp;</td>        </tr>        <tr>            <td>06.12.2011</td>            <td>General English I</td>            <td>7.30 a.m. - 10.00 a.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>Biology I</td>            <td>10.30 a.m. - 12.30 p.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>Combined Maths I</td>            <td>10.15 a.m. - 1.15 p.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>&nbsp;</td>            <td>&nbsp;</td>        </tr>        <tr>            <td>07.12.2011</td>            <td>General English II</td>            <td>7.30 a.m. -&nbsp;10.00 a.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>Biology II</td>            <td>10.15&nbsp;a.m. -&nbsp;1.15 p.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>Combined Maths II</td>            <td>10.15&nbsp;a.m. -&nbsp;1.15 p.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>&nbsp;</td>            <td>&nbsp;</td>        </tr>        <tr>            <td>08.12.2011</td>            <td>Physics I / Agriculture I</td>            <td>7.30 a.m. - 9.30 a.m.</td>        </tr>        <tr>            <td>&nbsp;</td>            <td>Physics II / Agriculture II</td>            <td>10.00 a.m. -&nbsp;1.00 p.m.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>        </tr>    </tbody></table>';messages[4] = '<div style="text-align: justify;">Royal College thumped their traditional rivals S. Thomas&rsquo; College to gain a resounding victory of 8 &ndash; 6 in their Annual Water Polo Encounter held on the 29<sup>th</sup> of October, Saturday, at the Police Pool Complex.&nbsp; Trailing 3 &ndash; 5 at half time, the Royalists made a brave comeback led in the forefront by their Captain Harshaka Nissanga.&nbsp;Harshaka Nissanga and Shan Lakshitha contributed with four goals each. <br />&nbsp;</div><strong>Royal College won the 1<sup>st</sup> Leg - 6 &ndash; 3. <br />Total Aggregate - 14 &ndash; 9<br /></strong><br />U15 team retained the Mahinda Liyanage Trophy. <br />Royal College won the 1<sup>st</sup> Leg 4-3<br />Royal College lost the 2<sup>nd </sup>Leg 4-5<br />Total Aggregate 8-8<br /><br />*Shan Lakshitha was adjudged as the <strong>Most Valuable Player</strong>.';messages[5] = '<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /><meta content="Word.Document" name="ProgId" /><meta content="Microsoft Word 11" name="Generator" /><meta content="Microsoft Word 11" name="Originator" /><link rel="File-List" href="file:///C:%5CDOCUME%7E1%5CAdmin%5CLOCALS%7E1%5CTemp%5Cmsohtml1%5C01%5Cclip_filelist.xml" /><!--[if gte mso 9]><xml><w:WordDocument><w:View>Normal</w:View><w:Zoom>0</w:Zoom><w:PunctuationKerning /><w:ValidateAgainstSchemas /><w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid><w:IgnoreMixedContent>false</w:IgnoreMixedContent><w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText><w:Compatibility><w:BreakWrappedTables /><w:SnapToGridInCell /><w:WrapTextWithPunct /><w:UseAsianBreakRules /><w:DontGrowAutofit /></w:Compatibility><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel></w:WordDocument></xml><![endif]--><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false" LatentStyleCount="156"></w:LatentStyles></xml><![endif]--><style type="text/css"><!-- /* Style Definitions */ p.MsoNormal, li.MsoNormal, div.MsoNormal	{mso-style-parent:"";	margin:0in;	margin-bottom:.0001pt;	mso-pagination:widow-orphan;	font-size:12.0pt;	font-family:"Times New Roman";	mso-fareast-f