></span></u></b><span style="line-height: 115%;"><br />1<sup>st</sup> Match &ndash; Royal College &lsquo;C&rsquo; vs Nalanda College &ndash; Royal lost -&nbsp; 9-2<br /><br />2<sup>nd</sup> Match (Semi Finals) &ndash; Royal College &lsquo;B&rsquo; vs Ananda College &ndash; Royal Won &ndash; 17-3<br /><br />3<sup>rd</sup> Match (Semi Finals) &ndash; Royal College &lsquo;A&rsquo; vs Nalanda College &ndash; Royal Won &ndash; 36-1<br /><br />4<sup>th</sup> Match (Finals) &ndash; Royal College &lsquo;A&rsquo; Team Was Given a Walk Over </span></span></span>  <b><span style="font-size: 24pt; line-height: 115%; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><br /></span></b>';messages[8] = '<pre><span style="font-size: small"><strong>** Royal won the 2nd place of the SEARCC International Schools\' Software Competition</strong></span><span style="font-size: small">Hashan Gayasri Udugahapattuwa and S. Chamod Pramudika Weerasinghe broughthonours to Royal College by winning the 2nd place of the SEARCCInternational Schools\' Software Competition 2010, which was held in Chennai,India from 22nd to 24th October.They Obtained the 2nd place by defeating the competitors who representedAustralia, New Zealand and India.** 1st place in All island QUIZ organized by Nalanda College Colombo. 27 Oct 2010.</span></pre>';messages[9] = '<!--[if gte mso 9]><xml><w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="true"DefSemiHidden="true" DefQFormat="false" DefPriority="99"LatentStyleCount="267"><w:LsdException Locked="false" Priority="0" SemiHidden="false"UnhideWhenUsed="false" QFormat="true" Name="Normal" /><w:LsdException Locked="false" Priority="9" SemiHidden="false"UnhideWhenUsed="false" QFormat="true" Name="heading 1" /><w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 2" /><w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 3" /><w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 4" /><w:LsdException Locked=