Century Gothic&quot;;mso-bidi-font-family:Tahoma"><o:p></o:p></span></i></p>';messages[56] = 'The Sinhala Inter-house drama compitition will be held for the year 2010 onthe 3rd of April at Navaragahala at 5:00 pm<br />';messages[57] = 'U-13 2nd Runner up<br />U-19&nbsp; Runner up<br />';messages[58] = '<u><strong>1st Round Match Vs. Wayamba Royal College</strong></u><br /><br /><strong>Wayamba Royal College 133 all out (42.3 overs)</strong><br />Bhanuka Rajapakshe - 3/23<br />Gaurav Deva - 2/30<br /><br /><strong>Royal College 134/7 (22 overs)</strong><br />Chalaka Bogoda - 21*<br />Madhusha Rajaratne - 19<br /><br /><strong>*** Royal College won by 3 wickets</strong><br /><br /><u><strong>Pre Quarter Finals Vs. Maris Stella College</strong></u><br /><br /><strong>Maris Stella College 100 all out (24 overs)</strong><br />Gaurav Deva - 2/15<br />Ramith Rambukwella - 2/8<br /><br /><strong>Royal College 101/4 (13.2 overs)</strong><br />Bhanuka Rajapakshe - 60<br /><br /><strong>*** Royal College won by 6 wickets</strong><br /><br /><u><strong>Quarter Finals Vs. Dharmapala College, Pannipitiya</strong></u><br /><u><br /></u><strong>Royal 269 all out (49.3 Overs</strong>)<br />Ramith Rambukwella&nbsp;- 116<br />Kithruwan Vithanage&nbsp;- 88<br type="_moz" /><br /><strong>Dharmapala College 160 all out (39.2 overs)</strong><br />Bhanuka Rajapakshe - 5/32<br /><br /><strong>***Royal won by 110 runs</strong>';messages[59] = '<strong>St.Thomas College 107 all out&nbsp;<br /></strong>Gaurav Deav 3 for13<br />Imran Khan 2 for 14<strong><br /><br />Royal College 62 (4.3 overs)<br /></strong>Kithriwan Vithanage 44 not out<br />Madusha Rajarathna 11 not out<br /><strong><br />***No Decision due to rain</strong>';messages[60] = '<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /><meta content="Word.Document" name="ProgId" /><meta content="Microsoft Word 11" name="Generator" /><meta content="Microsoft Word 11" name="Originator" /><link rel="File-List" href="file: